def cir_read_nexiim(cir_file):
  """.cir file element card:
  b_: ibis
  c_: RX replaced by RxCload as no ibis found
  S_: s-parmeter instance
  R_: discrete R, can be in series, pullup, pulldown
  L_: discrete L, can be in series, pullup, pulldown
  C_: discrete C, can be in series, pullup, pulldown
  .param
  .probe
  .tran
  .model
  .option
  """

  global my_netlist, my_circuit, my_parameters, my_specification, my_selections, my_project, cwd

  # open the circuit file netlist
  with open(cir_file, "r") as f:
    text = f.read().splitlines()
  cwd = os.path.dirname(cir_file)
  os.chdir(cwd)
  my_project.update({"root": os.path.dirname(cir_file)})
  my_project.update({"name": os.path.basename(cir_file).replace(".cir", "")})
  my_project.update({"stop": 3.5})
  # make it one-liner
  txt = []
  for s in text:
    s = s.strip()
    s = re.sub("\s+\$.+$", "", s)
    if s.startswith("*"):
      continue
    if s.startswith("+"):
      txt[-1] += s[1:]
    else:
      txt.append(s)
  txt = [re.sub("\s*=\s*", "=", x) for x in txt]
  my_netlist = [re.sub("\s+", " ", x) for x in txt]
  my_netlist = [x for x in my_netlist if bool(x)]
  ibis, snp, nodes, snpfile, inc, rxcap = [], [], [], {}, {}, {}
  for s in my_netlist:
    if s.startswith(".param"):
      assignment = s.split()[1]
      par, val = assignment.split("=")
      if "{" in val:
        val = re.sub(r'[\s\{\}"]', "", val).split(",")
      my_parameters.update({par: val})
      continue
    if s.startswith("b_"):
      ibsfile = re.search("file=(\S*)", s).groups()[0]
      pin = re.search("pin_name=(\S*)", s).groups()[0]
      node = s.split()[3]  # index 2 if ecl
      refdes = re.sub("_" + pin + "$", "", node)
      s.split("_")[1]
      comp = re.search("comp_name=(\S*)", s).groups()[0]
      signal = cir_get_signal_name(ibsfile.replace('"', ""), comp, pin)
      ibis.append(
          {
              "file": ibsfile,
              "comp": comp,
              "pin": pin,
              "signal": signal,
              "refdes": refdes,
              "node": node,
          }
      )
      continue
    # if s.startswith('c_U'):# a RX w/o buffer
    #     node = s.split()[1]
    #     partx,pinx = node.split('_')
    #     ibis.append({'file':'', 'comp':partx, 'pin':pinx,'signal':'','refdes':partx,'node':node})
    #     continue
    if s.startswith("c_"):
      words = s.split()
      if s.endswith("'RxCLoad'"):
        rxcap.update({words[1]: "RxCLoad"})
      else:
        rxcap.update({words[1]: words[-1]})

    if s.startswith("S_"):
      words = s.split()
      nodes.extend(words[1:-1])
      snp.append(
          {
              "name": words[0],
              "node": words[1:-1],
              "model": words[-1].split('"')[1],
              "file": "",
          }
      )
      continue
    if s.startswith(".model sModel"):
      words = s.split()
      snpfile.update({words[1]: words[3].split('"')[1]})
      continue
    if s.startswith(".inc"):
      file = s.split('"')[1]
      with open(file, "r") as f:
        for line in f:
          text = line.strip().lower()
          if text.startswith(".subckt"):
            words = re.split("\s+", line.strip())
            model = words[1]
            inc.update({model: file})
            break
    if s.startswith(".tran"):
      my_project["start"] = 0
      ss = s.split("start")
      if len(ss) > 1:
        z = re.findall(r".+\'(.+)/bps\'", ss[1])
        my_project["start"] = float(z[0]) if z else 0
      z = re.findall(r".+\'(.+)/bps\'", ss[0])
      my_project["stop"] = float(z[0]) if z else 3.5

    if s.startswith(".probe"):
      nodes.extend(re.findall("\(\s*(.*?)\s*\)", s))

  for i, s in enumerate(snp):
    snp[i]["file"] = snpfile[s["model"]]
  my_circuit.update({"ibis": ibis})
  my_circuit.update({"snp": snp})
  my_circuit.update({"inc": inc})
  for k, v in rxcap.items():
    if not "RxCLoad" in v:
      rxcap[k] = my_parameters[v]
  my_circuit.update({"rxc": rxcap})
  my_selections = my_parameters.copy()
  my_project.update({"nodes": list(set(nodes))})
  hasTX = "model='TxBuffer[iTxBuffer]'" in "\n".join(my_netlist)
  if hasTX and bool(ibis):
    Vinl, Vinh, Vmeas, Vdd = cir_buffer_spec(ibis[0]["file"].replace('"', ""), my_parameters["TxBuffer"][0])
    my_specification.update({"vih": Vinh[0]})
    my_specification.update({"vil": Vinl[0]})
    my_specification.update({"vdd": Vdd[0]})
    my_specification.update({"vmeas": Vmeas[0]})
    my_specification.update({"os": str(float(Vdd[0]) + 0.7)})
    my_specification.update({"rt": "10n"})


