def cir_buffer_spec(ibis_file, buffer):
  global my_specification

  Vinl, Vinh, Vmeas, Vdd = ([], [], [], [])
  numeric_const_pattern = "[-+]? (?: (?: \d* \. \d+ ) | (?: \d+ \.? ) )(?: [Ee] [+-]? \d+ ) ?"
  rex = re.compile(numeric_const_pattern, re.VERBOSE)
  with open(ibis_file) as f:
    text = f.read().splitlines()
  text = [x.strip() for x in text]
  text = [x for x in text if (x and x[0] != "|")]

  inblock = 0
  for line in text:
    if line.startswith("[Model]") and buffer in line:
      inblock = 1
    elif line.startswith("[") and inblock:
      inblock = 0
      break
    if inblock:
      if line.startswith("Vmeas"):
        Vmeas = rex.findall(re.split("\s*=\s*", line)[-1])
      if line.startswith("Vinl"):
        Vinl = rex.findall(re.split("\s*=\s*", line)[-1])
      if line.startswith("Vinh"):
        Vinh = rex.findall(re.split("\s*=\s*", line)[-1])

  inblock = 0
  for line in text:
    if line.startswith("[Model]") and buffer in line:
      inblock = 1
    if inblock and re.search(r"^\[Voltage Range\]", line, re.I):
      Vdd = rex.findall(line)
      break
    if inblock and re.search(r"^\[Pullup Reference\]", line, re.I):
      Vdd = rex.findall(line)
      break

  if not bool(Vmeas):
    Vmeas.append(str(float(Vdd[0]) / 2))
  if bool(Vmeas) and (not bool(Vinl)):
    Vinl.append(str(float(Vmeas[0]) * 0.6))
  if bool(Vmeas) and (not bool(Vinh)):
    Vinh.append(str(float(Vmeas[0]) * 1.4))
  my_specification.update({"vil": Vinl[0]})
  my_specification.update({"vih": Vinh[0]})
  my_specification.update({"vdd": Vdd[0]})
  my_specification.update({"vmeas": Vmeas[0]})

  return Vinl, Vinh, Vmeas, Vdd


def cir_get_signal_name(ibis_file, comp, pin):
  signal_name = ""
  with open(ibis_file) as f:
    text = f.read().splitlines()
  text = [x.strip() for x in text]
  text = [x for x in text if (x and x[0] != "|")]
  in_block = 0
  for line in text:
    if line.startswith("[Component]") and comp in line:
      in_block = 1
    if line.startswith("[Pin]") and in_block == 1:
      in_block = 2
    if in_block == 2:
      words = line.split()
      if words[0] == pin:
        signal_name = words[1]
        break
  return signal_name


def lst2str(array1):
  str1 = array1
  if str1[0] == "RxCLoad":
    return str1[0]
  if isinstance(array1, list):
    y = ['"{}"'.format(x) for x in array1]
    str1 = "[{}]".format(", ".join(y))
  return str1


def str2lst(str1):

  if ("{" in str1) or ("[" in str1):
    lst1 = re.sub(r'[\s\{\}\[\]"]', "", str1).split(",")
  else:
    lst1 = [str1]
  return lst1


