def run_transient(runs=0, gui=True):

  global my_selections, my_specification
  stop_time = str(my_project["stop"] / float(my_selections["bps"]))
  start_time = str(my_project["start"] / float(my_selections["bps"]))
  glitch_check_time = str(1.5 / float(my_selections["bps"]))

  oDesktop.RestoreWindow()
  oProject = oDesktop.GetActiveProject()
  oDesign = oProject.GetActiveDesign()

  txModels = my_selections["TxBuffer"]
  corners = my_selections["Corner"]
  # c_sweep = str2lst(my_selections['RxCLoad'])
  # my_selections['RxCLoad'] = '2e-12' #c_sweep

  if not gui:
    oModule = oDesign.GetModule("ReportSetup")
  elif not bool(runs):
    oModule = oDesign.GetModule("SimSetup")
    oModule.AddTransient(
        [
            "NAME:SimSetup",
            "DataBlockID:=",
            10,
            "OptionName:=",
            "(Default Options)",
            "AdditionalOptions:=",
            "",
            "AlterBlockName:=",
            "",
            "FilterText:=",
            "",
            "AnalysisEnabled:=",
            1,
            ["NAME:OutputQuantities"],
            ["NAME:NoiseOutputQuantities"],
            "Name:=",
            "NexximTransient",
            "TransientData:=",
            ["20ps", stop_time + "s"],
            "TransientNoiseData:=",
            [False, "", "", 0, 1, 0, False, 1],
            "TransientOtherData:=",
            ["default"],
        ]
    )
    oDesign.Analyze("NexximTransient")
    oModule = oDesign.GetModule("Optimetrics")
    for param, sweeps in my_selections.items():
      if not isinstance(sweeps, list):
        continue
      oModule.InsertSetup(
          "OptiParametric",
          [
              "NAME:Parametric" + param,
              "UseFastCalculationUpdateAlgo:=",
              True,
              "FastCalcOptCtrledByUser:=",
              False,
              "IsEnabled:=",
              True,
              "SaveSolutions:=",
              True,
              ["NAME:StartingPoint"],
              "Sim. Setups:=",
              ["NexximTransient"],
              [
                  "NAME:Sweeps",
                  [
                      "NAME:SweepDefinition",
                      "Variable:=",
                      "i" + param,
                      "Data:=",
                      "LIN 0 " + str(len(sweeps) - 1) + " 1",
                      "OffsetF1:=",
                      False,
                      "Synchronize:=",
                      0,
                  ],
              ],
              ["NAME:Sweep Operations"],
              ["NAME:Goals"],
          ],
      )
  else:
    oDesign.Analyze("NexximTransient")
    oModule = oDesign.GetModule("Optimetrics")
    for param, sweeps in my_selections.items():
      if not isinstance(sweeps, list):
        continue
      oModule.EditSetup(
          "Parametric" + param,
          [
              "NAME:Parametric" + param,
              "UseFastCalculationUpdateAlgo:=",
              True,
              "FastCalcOptCtrledByUser:=",
              False,
              "IsEnabled:=",
              True,
              "SaveSolutions:=",
              True,
              ["NAME:StartingPoint"],
              "Sim. Setups:=",
              ["NexximTransient"],
              [
                  "NAME:Sweeps",
                  [
                      "NAME:SweepDefinition",
                      "Variable:=",
                      "i" + param,
                      "Data:=",
                      "LIN 0 " + str(len(sweeps) - 1) + " 1",
                      "OffsetF1:=",
                      False,
                      "Synchronize:=",
                      0,
                  ],
              ],
              ["NAME:Sweep Operations"],
              ["NAME:Goals"],
          ],
      )

  if bool(runs):
    oDesign.InvalidateAllSolutions()
    oDesign.Analyze("NexximTransient")
  if not gui:
    oProject.AnalyzeAll()
  elif len(my_selections["TxBuffer"]) > 1:
    oModule.SolveSetup("ParametricTxBuffer")
  elif len(my_selections["Corner"]) > 1:
    oModule.SolveSetup("ParametricCorner")
  elif len(my_selections["RxCLoad"]) > 1:
    oModule.SolveSetup("ParametricRxCLoad")

  oModule = oDesign.GetModule("ReportSetup")
  if bool(runs):
    oModule.UpdateAllReports()
    # add below for loop to bring reprot window up front
    oModule.OpenWindowForAllReports()
