def rpt_export_html(sch=True):

  class html:

    def __init__(self, file_path):
      self.file_path = os.path.abspath(file_path)
      self.vid = 0

    def __enter__(self):
      self.data = [header, "<body>"]
      return self

    def __exit__(self, exc_type, exc_val, exc_tb):
      self.data += ["</body>", "</html>"]
      with open(self.file_path, "w") as f:
        f.write("\n".join(self.data))
      if sch:
        webbrowser.open(self.file_path)

    def H1(self, x):
      self.data += ["<h1>{}</h1>".format(x)]

    def H2(self, x):
      self.data += ["<h1>[{}]</h1>".format(x)]

    def H3(self, x):
      self.data += ['<h2 style="color:blue;">{}</h2>'.format(x)]

    def p(self, x):
      self.data += ["<p>{}</p>".format(x)]

    def strong(self, x):
      self.data += ['<strong style="color:blue;">{}</strong>'.format(x)]

    def ul(self, x):
      self.data += ["<ul>"] + ["<li>{}</li>".format(i) for i in x] + ["</ul>"]

    def ol(self, x):
      self.data += ["<ol>"] + ["<li>{}</li>".format(i) for i in x] + ["</ol>"]

    def link(self, text, url):
      self.data += ['<a href="{}">{}</a>'.format(url, text)]

    def image(self, path, width=400):
      self.data += ['<img src={} width="{}">'.format(path, width)]

    def image64(self, path):
      with open(path, "rb") as file:
        file_content = file.read()
        encoded = base64.b64encode(file_content).decode("utf-8")
        self.data += ['<img src="data:image/png;base64,{}">'.format(encoded)]

      # encoded = base64.b64encode(open(path, "rb").read()).decode("utf-8")
      # self.data += ['<img src="data:image/png;base64,{}">'.format(encoded)]

    def hr(self):
      self.data += ["<hr>"]

    def table(self, value):
      self.data += ['<table class="tg">']
      x = ['<th class="tg-6484">{}</th>'.format(i) for i in value[0]]
      self.data += ["<thead>", "<tr>", "<*x>", "<tr>", "</thead>", "<tbody>"]

      for row in value[1:]:
        x = ['<td class="tg-baqh">{}</td>'.format(i) for i in row]
        self.data += ["<thead>", "<tr>", "<*x>", "<tr>", "</thead>"]
      self.data += ["</tbody>", "</table>"]

    def summary(self, title, content):
      self.data += [
          "<details>",
          "<summary>{}</summary>".format(title),
          "<p>{}</p>".format(content),
          "</details>",
      ]

    def xyplot(self, data, x_axis):
      value = []
      for k in data:
        for n, v in enumerate(data[k]):
          try:
            value[n][k] = v
          except:
            value.append({k: v})

      value = str(value).replace("'", '"')
      repeat = ",".join(['"{}"'.format(i) for i in data.keys() if i != x_axis])
      result = (
          xy_template.replace("$repeat$", repeat)
          .replace("$x$", x_axis)
          .replace("$value$", value)
          .replace("$vid$", str(self.vid))
      )
      self.vid += 1

      self.data += [result]

