  def Form1_Load(self, sender, e):
    # oDesktop.OpenProject(file)
    global my_netlist, my_circuit, my_parameters, my_specification, my_selections, my_project, cwd

    dialog = OpenFileDialog()
    dialog.Filter = "ansys designer netlist(*.cir)|*.cir"
    if dialog.ShowDialog(self) == DialogResult.OK:
      cir_read_nexiim(dialog.FileName)
      if not bool(my_circuit["ibis"]):
        MessageBox.Show("No buffer model found!")
        # return
    else:
      return

    ibis = my_circuit["ibis"]
    self.txtTxPartNo.Text = ibis[0]["refdes"]
    self.txtTxPin.Text = ibis[0]["pin"]
    self.txtDataRate.Text = my_parameters["bps"]
    for buffer in my_parameters["TxBuffer"]:
      self.lstDrvStrength.Items.Add(buffer)
    pass
    self.txtVIH.Text = my_specification["vih"]
    self.txtVIL.Text = my_specification["vil"]
    self.txtVDD.Text = my_specification["vdd"]
    self.txtVmeas.Text = my_specification["vmeas"]
    self.txtOvershoot.Text = my_specification["os"]
    self.txtRiseTime.Text = my_specification["rt"]

    # populate the RX buffer data
    for i in range(1, len(ibis)):
      index = self.dataViewRX.Rows.Add()
      self.dataViewRX.Rows[index].Cells[0].Value = "b." + ibis[i]["refdes"]
      self.dataViewRX.Rows[index].Cells[1].Value = ibis[i]["pin"]
    for rxc, value in my_circuit["rxc"].items():
      words = rxc.split("_")
      index = self.dataViewRX.Rows.Add()
      self.dataViewRX.Rows[index].Cells[0].Value = "c." + "_".join(words[:-1])
      if value in "RxCLoad":
        self.dataViewRX.Rows[index].Cells[1].Value = words[-1]
      else:
        self.dataViewRX.Rows[index].Cells[1].Value = words[-1] + "=" + value

    for para, value in my_parameters.items():
      if para in ["Corner", "RxCLoad", "TxBuffer"]:
        continue
      z = re.search(r"^([a-zA-Z0-9]+?_)?((R|C|L|Q|D|XW|FB).*)", para)
      if z:
        # MessageBox.Show(para)
        discrete = z.groups()[1]
      else:
        discrete = para
      if any(discrete.startswith(x) for x in "R L C Q D XW FB".split()):
        index = self.dataViewRes.Rows.Add()
        self.dataViewRes.Rows[index].Cells[0].Value = para
        self.dataViewRes.Rows[index].Cells[1].Value = value
    index = self.dataViewCap.Rows.Add()
    self.dataViewCap.Rows[index].Cells[0].Value = "RxCLoad"
    self.dataViewCap.Rows[index].Cells[1].Value = lst2str(my_parameters["RxCLoad"])

    self.chkSweepCL.Enabled = False
    self.chkSweepRes.Enabled = False
    self.chkSweepCap.Enabled = False
    sch_add_variables()

    sch_add_driver()
    sch_add_channel()
    sch_add_receivers()
    self.runs = -1

