  def txtDataRate_TextChanged(self, sender, e):
    numeric_const_pattern = "[-+]? (?: (?: \d* \. \d+ ) | (?: \d+ \.? ) )(?: [Ee] [+-]? \d+ ) ?"
    rex = re.compile(numeric_const_pattern, re.VERBOSE)
    unit_map = {"k": 1e3, "x": 1e6, "m": 1e6, "g": 1e9}
    if bool(self.txtDataRate.Text):
      bps = rex.findall(self.txtDataRate.Text)[-1]
      unit = self.txtDataRate.Text[-1]
      if unit in unit_map:
        bps = str(float(bps) * unit_map[unit])
      my_selections.update({"bps": bps})
    else:
      my_selections.update({"bps": ""})

