def command_line(argstr):
  htmls = {}

  z = re.split(r"[\s=]+", argstr)
  if len(z) % 2:
    return
  args = dict(zip(z[::2], z[1::2]))
  cwd = args["cwd"] if "cwd" in args else None
  skip_simed = False if ("skip_simed" in args and "false" == args["skip_simed"].lower()) else True
  if cwd is None or os.path.exists(cwd) is False:
    return

  if os.path.isdir(cwd):
    os.chdir(cwd)
    files = glob.glob(cwd + "/*.cir")
  elif os.path.isfile(cwd):
    os.chdir(os.path.dirname(cwd))
    files = [cwd]
  else:
    return

  for file in files:
    html = re.sub("\.cir$", ".htm", file)
    # if skip
    if os.path.isfile(html) and skip_simed:
      continue

    net = os.path.splitext(os.path.basename(file))[0]
    with open(file, "r") as f:
      text = f.read()

    # if no TX
    z = re.search("\n\.tran\s.+(sweep \w+).+\n", text)
    if z:
      cmd = z.group(1)
    else:
      htmls.update({net: "NO_TX_FOUND!"})  # NO_TX_FOUND!
      continue

    # if no probing
    z = re.search("\n\.probe tran\s.+", text)
    if z:
      pass
    else:
      htmls.update({net: "NO_RX_FOUND!"})  # NO_RX_FOUND!
      continue

    aedt = re.sub("\.cir$", ".aedt", file)
    fresh_project(gui=False)
    cir_read_nexiim(file)
    # reduce nodes to probe nodes only exlicitly in command line mode
    nodes = []
    for line in my_netlist:
      if line.startswith(".probe"):
        nodes += re.findall("\(\s*(.*?)\s*\)", line)
    my_project.update({"nodes": nodes})

    try:
      # oProject = oDesktop.NewProject()
      oDesktop.OpenProject(file)
      run_transient(runs=0, gui=False)
      rpt_export_html(sch=False)
      oProject = oDesktop.SetActiveProject(net)
      oProject.SaveAs(aedt, True)
      oDesktop.CloseProject(net)
    except KeyboardInterrupt:
      MessageBox.Show("interrupted")

    # open(html,'wb').write(open(cir,'rb').read())
    if os.path.exists(html) and os.path.isfile(html):
      htmls.update({net: html.replace("\\", "/")})

  if cmd in locals():
    res_html = os.path.dirname(cwd) + "/" + re.sub("\s", "_", cmd) + time + ".html"
  else:
    res_html = os.path.dirname(cwd) + "/sweep_" + time + ".html"

  with open(res_html, "w") as f:
    f.write("<html>\n<head>\n<title>Nexiim Sweep Results</title>\n</head>\n<body>\n")
    for net, html in htmls.items():
      if html in ["NO_TX_FOUND!", "NO_RX_FOUND"]:
        f.write("<p>{}: {}</p>\n".format(net, html))
      elif os.path.isfile(html):
        f.write('<p><a href="{}">{}</a></p>\n'.format(html, net))

    f.write("</body>\n</html>")
  webbrowser.open(res_html)


